import { useState } from "react";
import { VuiFlexContainer, VuiFlexItem, VuiTitle, VuiText, VuiSpacer, VuiCard } from "../../ui";
import { useSearchContext } from "../../contexts/SearchContext";
import "./exampleQuestions.scss";

interface ExampleQuery {
  text: string;
}

export const ExampleQuestions = () => {
  const { onSearch } = useSearchContext();
  const [queries] = useState<ExampleQuery[]>([
    { text: "How much are Apple's R&D expenses?" },
    { text: "how does Morgan Stanley value investments?" },
    { text: "what is the Performance Rankings and Quintiles of the Andromeda global growth fund?" },
    { text: "What are the contractual management fees expenses for the Jupiter Large Cap?" },
  ]);

  return (
    <VuiFlexContainer direction="column" alignItems="center" className="exampleQuestionsContainer">
      <VuiFlexItem>
        <VuiTitle size="m">
          <h2>Try one of these example queries:</h2>
        </VuiTitle>
      </VuiFlexItem>

      <VuiSpacer size="l" />

      <VuiFlexItem>
        <VuiFlexContainer direction="column" spacing="m">
          {queries.map((query, index) => (
            <VuiFlexItem key={index}>
              <VuiCard
                className="exampleQuestionCard"
                onClick={() => onSearch({ value: query.text })}
                padding="m"
              >
                <VuiText>
                  <p>{query.text}</p>
                </VuiText>
              </VuiCard>
            </VuiFlexItem>
          ))}
        </VuiFlexContainer>
      </VuiFlexItem>
    </VuiFlexContainer>
  );
};
